// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract UserAuthV2 {
    // Struct to hold public key data
    struct PublicKey {
        string key;
        bool isActive;
    }

    // Struct for digital certificate information
    struct Certificate {
        string country;
        string state;
        string locality;
        string organization;
        string commonName;
        uint256 serialNumber;
        uint256 validFrom;
        uint256 validTo;
    }

    // Main user struct
    struct User {
        address userAddress;
        string username;
        bool isRegistered;
        bool isAdmin;
        PublicKey[] publicKeys;
        Certificate certificate;
    }

    mapping(address => User) public users;
    mapping(string => address) public usernameToAddress;
    mapping(bytes32 => bool) private serialNumberExists; // To ensure serial numbers are unique

    address public owner;

    event UserRegistered(address indexed userAddress, string username);
    event AdminStatusChanged(address indexed userAddress, bool isAdmin);
    event PublicKeyAdded(address indexed userAddress, uint keyIndex, string key);
    event PublicKeyDeactivated(address indexed userAddress, uint keyIndex);
    event CertificateUpdated(address indexed userAddress, uint256 serialNumber);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier isRegistered() {
        require(users[msg.sender].isRegistered, "User is not registered");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function registerUser(string calldata _username, string calldata _initialPublicKey) public {
        require(!users[msg.sender].isRegistered, "User already registered");
        require(usernameToAddress[_username] == address(0), "Username is already taken");

        users[msg.sender].userAddress = msg.sender;
        users[msg.sender].username = _username;
        users[msg.sender].isRegistered = true;
        users[msg.sender].isAdmin = false; // By default, user is not an admin

        // Add the initial public key
        users[msg.sender].publicKeys.push(PublicKey({
            key: _initialPublicKey,
            isActive: true
        }));

        usernameToAddress[_username] = msg.sender;
        emit UserRegistered(msg.sender, _username);
        emit PublicKeyAdded(msg.sender, 0, _initialPublicKey);
    }

    function addPublicKey(string calldata _newPublicKey) public isRegistered {
        PublicKey[] storage keys = users[msg.sender].publicKeys;
        for (uint i = 0; i < keys.length; i++) {
            require(keccak256(abi.encodePacked(keys[i].key)) != keccak256(abi.encodePacked(_newPublicKey)), "Public key already exists");
        }

        uint newKeyIndex = users[msg.sender].publicKeys.length;
        users[msg.sender].publicKeys.push(PublicKey({
            key: _newPublicKey,
            isActive: true
        }));
        emit PublicKeyAdded(msg.sender, newKeyIndex, _newPublicKey);
    }

    function deactivatePublicKey(uint _keyIndex) public isRegistered {
        require(_keyIndex < users[msg.sender].publicKeys.length, "Invalid key index");
        require(users[msg.sender].publicKeys[_keyIndex].isActive, "Key is already inactive");

        // Ensure at least one active key remains
        uint activeKeys = 0;
        for (uint i = 0; i < users[msg.sender].publicKeys.length; i++) {
            if (users[msg.sender].publicKeys[i].isActive) {
                activeKeys++;
            }
        }
        require(activeKeys > 1, "Cannot deactivate the only active key");

        users[msg.sender].publicKeys[_keyIndex].isActive = false;
        emit PublicKeyDeactivated(msg.sender, _keyIndex);
    }

    function createOrUpdateCertificate(
        string calldata _country,
        string calldata _state,
        string calldata _locality,
        string calldata _organization,
        string calldata _commonName
    ) public isRegistered {
        // For simplicity, we'll generate a pseudo-random serial number.
        // In a real-world scenario, this should be handled more robustly.
        uint256 newSerialNumber = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender, _commonName)));
        require(!serialNumberExists[bytes32(newSerialNumber)], "Serial number collision. Please try again.");

        users[msg.sender].certificate = Certificate({
            country: _country,
            state: _state,
            locality: _locality,
            organization: _organization,
            commonName: _commonName,
            serialNumber: newSerialNumber,
            validFrom: block.timestamp,
            validTo: block.timestamp + 365 days // Certificate valid for 1 year
        });

        serialNumberExists[bytes32(newSerialNumber)] = true;

        emit CertificateUpdated(msg.sender, newSerialNumber);
    }

    function getUserData() public view isRegistered returns (User memory) {
        return users[msg.sender];
    }

    function getPublicKeys(address _userAddress) public view returns (PublicKey[] memory) {
        require(users[_userAddress].isRegistered, "User is not registered");
        return users[_userAddress].publicKeys;
    }

    function getCertificate(address _userAddress) public view returns (Certificate memory) {
        require(users[_userAddress].isRegistered, "User is not registered");
        return users[_userAddress].certificate;
    }

    function setAdmin(address _userAddress, bool _isAdmin) public onlyOwner {
        require(users[_userAddress].isRegistered, "User is not registered");
        users[_userAddress].isAdmin = _isAdmin;
        emit AdminStatusChanged(_userAddress, _isAdmin);
    }
}
